import React from 'react';
import './Home.css';
import Navbar from './Navbar/Navbar';
import TitlePage from './Title/TitlePage'; 
import Footer from './Footer/Footer'

const Home = () => {
  return (
    <div className="home">
      <Navbar />
      <TitlePage />
      <Pool name="Pool Rohit" ticketPrice="$10" duration="2 weeks" />
      <Pool name="Pool Adi" ticketPrice="$15" duration="3 weeks" />
      {/* Add more pools */}
      <Footer />
    </div>
  );
}

export default Home;
